import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for and fill minimum price filter
    await page.waitForSelector('#minPrice', { timeout: 5000 });
    await page.fill('#minPrice', '50');

    // Wait for and fill maximum price filter
    await page.waitForSelector('#maxPrice', { timeout: 5000 });
    await page.fill('#maxPrice', '200');

    // Take screenshot after filling price inputs
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_price_filled.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_price_filled.png'));

    // Click apply filter button
    await page.waitForSelector('.apply-filter', { timeout: 5000 });
    await page.click('.apply-filter');

    // Wait for filter to be applied and take final screenshot
    await page.waitForTimeout(1000);
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_filter_applied.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_filter_applied.png'));

    // Extract product prices to verify filter was applied
    const productPrices = await page.$$eval('.product-price', prices => 
      prices.map(price => {
        const text = price.textContent;
        const amount = text.match(/\$([\d.]+)/);
        return amount ? parseFloat(amount[1]) : 0;
      })
    );

    return {
      success: true,
      action: "Applied price range filter ($50-$200) and verified results",
      extractedData: {
        productCount: productPrices.length,
        minPrice: Math.min(...productPrices),
        maxPrice: Math.max(...productPrices),
        allPrices: productPrices
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to apply price range filter",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
